description:
Я единственный владелец, заказывала и приобретала новую машину у официального дилера в 2008 году. На тот момент максимальная комплектация luxury - в описании характеристик. Все функции в отличном рабочем состоянии, подсветка горит, наклейки на месте.
За период эксплуатации  (все расходники и запчасти оригиналы): 
1. Менялись задние пружины;
2. антибактериальная обработка кондиционера, последняя летом "18;
3. замена масла в акпп "16 - по нормам (на пробеге 250 тыс);
4. все ТО вовремя пройдены, с заменой всех фильтров, свечей и тд.;
 Из минусов: трещина на лобовом стекле со стороны пассажира- водителю не мешает (расходник); пора менять передние колодки. 
Желательно оформление в ГИБДД.
 Номер Авто, Вин, Сервисные книжки, чеки на ремонтные работы, 2 ключа в комплекте с сигнализацией и прочие данные предоставлю оригиналы, торг на месте после осмотра.
Перекурам и автосалонам не звонить.
